import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { CityState } from "../../../src/redux/reducer/weatherReducer";
import { fetchCities } from "../../redux/actions/actions";

export default function CityList() {
  const dispatch = useDispatch();
  const fetchedCities = useSelector<CityState, CityState["cities"]>(
    (state) => state.cities
  );
  return (
    <div>
      <h1>AA</h1>
      <button onClick={() => dispatch(fetchCities() as any)}>
        FETCH CITIES
      </button>
      <button onClick={() => console.log(fetchedCities)}>Console log</button>
    </div>
  );
}
